function showUI(elem){
      if(elem==1){
         $.blockUI({ message: '<img src="http://www.subastas.maxilana.com/assets/img/spin.gif" />' ,
          baseZ: 2000,
          css: { width: '4%', border:'0px solid #FFFFFF',cursor:'wait',backgroundColor:'none'},
          overlayCSS:  { backgroundColor: '#fffcfc',opacity:0.9,cursor:'wait'} 
          }); 
      }else{
          $.unblockUI();
      }
  }

  function showMsg(title,contentMsg,type){
      $.alert({
        title:title,
        type:type,
        content:contentMsg
      });
  }

  function confirmOkOnly(type,content,title,link){
      $.confirm({
            title: title,
            type:type,
            content: content,
            autoClose: 'ok|5000',  
            buttons: {
                ok: function(){
                    if(link!=""){
                      showUI(1);
                      window.location=link;
                    }
                }
            }
      });
  }
